import React from 'react';
import Carouselitem from '../../../../General/Carousel/carouselitem.js';
import Carouselindicator from '../../../../General/Carousel/carouselindicator.js';
import DiscountJson from './discountJson.js';
import Carousel from '../../../../General/Carousel/carousel.js';
import '../carousel.css'

class Carousel1 extends React.Component{
  render() {
    const carouselitems = DiscountJson.map(oneitem =>
        <Carouselitem
           imgName = {oneitem.imgName}
           imgsrc = {oneitem.imgsrc}
           imgalt = {oneitem.imgalt}
           caption = {oneitem.caption}
           href = {oneitem.href}
         />)
   const carouselindicators = DiscountJson.map(oneitem =>
     <Carouselindicator
     target = {oneitem.indicators.target}
     slideto = {oneitem.indicators.slideto}
     indclassName = {oneitem.indicators.indclassName}
     />
       )
    return (
      <Carousel
        id="discounts"
        class="carousel slide "
        data="carousel"
        href="#discounts"
        carouselitems ={carouselitems}
        carouselindicators ={carouselindicators}
        />
    )
  }
}
export default Carousel1
